import React, { Component } from 'react'
import Pop from '../pages/Pop'
import PopupApp from '../pages/pop'

export class Exploits extends Component {
  render() {
    return (
      <div>
        <PopupApp />
        <Pop />
      </div>
    )
  }
}

export default Exploits
